import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import { postDog, getTemperaments } from "../actions";
import { useDispatch, useSelector } from "react-redux";

const DogCreate = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate(); //se usa para redirigir a alguna ruta //v de react reemplaza a useHistory//me redirige a la ruta que yo le diga
  const temperaments = useSelector((state) => state.temperaments);

  const [input, setInput] = useState({
    image: "https://placedog.net/640/480?random",
    name: "",
    heightMin: "0",
    heightMax: "9",
    height: "",
    weightMin: "0",
    weightMax: "1",
    weight: "",
    life_span: "",
    temperaments: [],
  });

  function handleChange(e) {
    setInput({
      ...input,
      [e.target.name]: e.target.value,
    });
    console.log(input);
  }

  function handleSelect(e) {
    setInput({
      ...input,
      temperaments: [...input.temperaments, e.target.value],
    });
  }

  function handleSubmit(e) {
    e.preventDefault();
    console.log(input);
    dispatch(postDog(input));
    alert("Dog created 🐶");
    setInput({
      image: "https://placedog.net/640/480?random",
      name: "",
      heightMin: "",
      heightMax: "",
      height: "",
      weightMin: "",
      weightMax: "",
      weight: "",
      life_span: "",
      temperament: [],
    });
    navigate("/home");
  }

  useEffect(() => {
    dispatch(getTemperaments());
  }, [dispatch]);

  return (
    <div>
      <Link as={Link} to="/home">
        <button>HOME</button>
      </Link>
      <h1>BE CREATIVE 🐾</h1>
      <form onSubmit={(e) => handleSubmit(e)}>
        <div>
          <label>Name:</label>
          <input
            placeholder="Dog Name"
            type="text"
            value={input.name}
            name="name"
            onChange={(e) => handleChange(e)}
          ></input>
        </div>
        <div>
          <label>imagen:</label>
          <input
            placeholder="Image"
            type="img"
            value={input.image}
            name="image"
            onChange={(e) => handleChange(e)}
            alt="not found"
          ></input>
        </div>
        <div>
          <label>Heigth Min:</label>
          <input
            placeholder="Min height"
            type="number"
            value={input.heightMin}
            name="heightMin"
            onChange={(e) => handleChange(e)}
          ></input>
        </div>
        <div>
          <label>Heigth Max:</label>
          <input
            placeholder="Max height"
            type="number"
            value={input.heightMax}
            name="heightMax"
            onChange={(e) => handleChange(e)}
          ></input>
        </div>
        <div>
          <label>Weight Min:</label>
          <input
            placeholder="Min weight"
            type="number"
            value={input.weightMin}
            name="weightMin"
            onChange={(e) => handleChange(e)}
          ></input>
        </div>
        <div>
          <label>weigth Max:</label>
          <input
            placeholder="Max weight"
            type="number"
            value={input.weightMax}
            name="weightMax"
            onChange={(e) => handleChange(e)}
          ></input>
        </div>
        <div>
          <label>life span:</label>
          <input
            placeholder="life span"
            type="number"
            value={input.life_span}
            name="life_span"
            onChange={(e) => handleChange(e)}
          ></input>
        </div>
        {/* <div>
          <label>Max life years:</label>
          <input
            className="input"
            placeholder="Max life years"
            type="number"
            value={input.lifemax}
            name="lifemax"
            onChange={(e) => handleChange(e)}
          />
        </div> */}
        <select onChange={(e) => handleSelect(e)}>
          {temperaments.map((temp) => (
            <option key={temp.id} value={temp.name}>
              {temp.name}
            </option>
          ))}
        </select>
        <ul>
          <li>{input.temperaments.map((el) => el + " ,")}</li>
        </ul>

        <button type="submit">Crear Dogs</button>
      </form>
    </div>
  );
};

export default DogCreate;
